import NavBar from './components/NavBar'
import Footer from './components/Footer'
const h4={
  fontSize:'15px'
}

 class Hero extends React.Component {
  render() {
    return (
        <>
        <NavBar />
      <Footer />
        </>
    )
  }
}

export default Hero
